function sendRequestScript(link, method){
  loadnig();
  $.ajax({
    type: method,
    url: link,
    dataType: "script",
    success: function(data){
      loaded();
    },
    error: function(errorMessage){
      loaded();
    }
  });
}

function showNotification(type, message){
  icon = "notifications";
  switch(type) {
    case "info":
      icon = "info_outline";
      break;
    case "notice":
      icon = "info_outline";
      type = "info";
      break;
    case "success":
      icon = "done";
      break;
    case "warning":
      icon = "warning";
      break;
    case "danger":
      icon = "error_outline";
      break;
    case "error":
      icon = "error_outline";
      type = "danger";
      break;
    case "primary":
      icon = "notifications";
      break;
    default:
      icon = "notifications";
  }
  $.notify({
    icon: icon,
    message: message
  },{
    type: type,
    timer: 1000,
    placement: {
      from: "top",
      align: "right"
    }
  });
}

